import React from 'react';
import {ImageWrapper, PropertyInfoWrapper, PropertyTypeCardWrapper} from "./styled";

export const PropertyCard = () => {
    return (
        <PropertyTypeCardWrapper>
            <ImageWrapper>
             Imagen...
            </ImageWrapper>
            <PropertyInfoWrapper>
                Info...
            </PropertyInfoWrapper>
        </PropertyTypeCardWrapper>
    );
};
